void MarchingCube::LoadBinarySTL(const char* szFile)
{
    struct stat fs;
    unsigned long len;
    if (stat(szFile, &fs) == 0) {
        len = static_cast<unsigned long>(fs.st_size);
    }

    if (len <= 80 + 4 + 50){
        Logger::Error("invalid stl file[%s]", szFile);
        return;
    }
    m_facet3Ds.clear();

    FILE* fp = fopen(szFile, "rb");
    char header[80];
    fread(header, 80, sizeof(char), fp);
    unsigned long numOfFacet = 0;
    fread(&numOfFacet, 4, 1, fp);

    float xmin=FLT_MAX, xmax=FLT_MIN;
    float ymin=FLT_MAX, ymax=FLT_MIN;
    float zmin=FLT_MAX, zmax=FLT_MIN;
    
    for (int i=0; i<numOfFacet; i++){
        Facet3D facet;
        fread(&facet, 50, 1, fp);
        m_facet3Ds.push_back(facet);

        xmin = min(xmin, min(facet.v1.x(), min(facet.v2.x(), facet.v3.x())));
        xmax = max(xmax, max(facet.v1.x(), max(facet.v2.x(), facet.v3.x())));
        ymin = min(ymin, min(facet.v1.y(), min(facet.v2.y(), facet.v3.y())));
        ymax = max(ymax, max(facet.v1.y(), max(facet.v2.y(), facet.v3.y())));
        zmin = min(zmin, min(facet.v1.z(), min(facet.v2.z(), facet.v3.z())));
        zmax = max(zmax, max(facet.v1.z(), max(facet.v2.z(), facet.v3.z())));
    }

    //Normalize to [-0.5, 0.5]
    float xlen = xmax - xmin;
    float ylen = ymax - ymin;
    float zlen = zmax - zmin;
    float maxlen = max(xlen, zlen);

    Point3f ptCenter((xmin+xmax)/2, (ymin+ymax)/2, (zmin+zmax)/2);

    for (size_t i=0; i<m_facet3Ds.size(); i++){
        Facet3D& facet = m_facet3Ds[i];
        facet.v1 -= ptCenter;
        facet.v2 -= ptCenter;
        facet.v3 -= ptCenter;
        facet.v1 /= maxlen;
        facet.v2 /= maxlen;
        facet.v3 /= maxlen;
        facet.v1.SetZ(-facet.v1.z());
        facet.v2.SetZ(-facet.v2.z());
        facet.v3.SetZ(-facet.v3.z());
    }
    
    fclose(fp);
}

void MarchingCube::LoadHumanMesh()
{
    std::string strData = Base64::Decode(m_b64_human.c_str(), m_b64_human.size());
    if (strData.size() <= 80 + 4 + 50){
        return;
    }
    m_facet3Ds.clear();

    unsigned char* pData = (unsigned char*)strData.c_str(); 

    unsigned long numOfFacet = 0;
    memcpy(&numOfFacet, pData+80, 4);
    pData += 84;

    float xmin=FLT_MAX, xmax=FLT_MIN;
    float ymin=FLT_MAX, ymax=FLT_MIN;
    float zmin=FLT_MAX, zmax=FLT_MIN;
    
    for (int i=0; i<numOfFacet; i++){
        Facet3D facet;
        memcpy(&facet, pData, 50);
        pData += 50;

        m_facet3Ds.push_back(facet);

        xmin = min(xmin, min(facet.v1.x(), min(facet.v2.x(), facet.v3.x())));
        xmax = max(xmax, max(facet.v1.x(), max(facet.v2.x(), facet.v3.x())));
        ymin = min(ymin, min(facet.v1.y(), min(facet.v2.y(), facet.v3.y())));
        ymax = max(ymax, max(facet.v1.y(), max(facet.v2.y(), facet.v3.y())));
        zmin = min(zmin, min(facet.v1.z(), min(facet.v2.z(), facet.v3.z())));
        zmax = max(zmax, max(facet.v1.z(), max(facet.v2.z(), facet.v3.z())));
    }

    //Normalize to [-0.5, 0.5]
    float xlen = xmax - xmin;
    float ylen = ymax - ymin;
    float zlen = zmax - zmin;
    float maxlen = max(xlen, zlen);

    Point3f ptCenter((xmin+xmax)/2, (ymin+ymax)/2, (zmin+zmax)/2);

    for (size_t i=0; i<m_facet3Ds.size(); i++){
        Facet3D& facet = m_facet3Ds[i];
        facet.v1 -= ptCenter;
        facet.v2 -= ptCenter;
        facet.v3 -= ptCenter;
        facet.v1 /= maxlen;
        facet.v2 /= maxlen;
        facet.v3 /= maxlen;
        facet.v1.SetZ(-facet.v1.z());
        facet.v2.SetZ(-facet.v2.z());
        facet.v3.SetZ(-facet.v3.z());
    }
}

std::vector<Facet2D> MarchingCube::GetMeshPoints()
{
    std::vector<Facet2D> facet2Ds;
    for (size_t i=0; i<m_facet3Ds.size(); i++){
        float d = m_facet3Ds[i].n.dot(Direction3f(0, 1, 0));
        if (d < 0){
            continue;
        }
        Facet2D facet2D;
        facet2D.diffuse = d;
        facet2D.v1 = Point2f(m_facet3Ds[i].v1.x(), m_facet3Ds[i].v1.z());
        facet2D.v2 = Point2f(m_facet3Ds[i].v2.x(), m_facet3Ds[i].v2.z());
        facet2D.v3 = Point2f(m_facet3Ds[i].v3.x(), m_facet3Ds[i].v3.z());
        facet2Ds.push_back(facet2D);
    }
    return facet2Ds;
}